import React from 'react';
import { DataGrid } from '@material-ui/data-grid';
import { useSelector } from "react-redux";

const columns = [
  { field: 'firstName', headerName: 'First Name', width: 70 },
  { field: 'lastName', headerName: 'Last Name', width: 130 },
  { field: 'friendCount', headerName: 'Friend Count', width: 130 }
];

const rows = [];

export default function DataTable() {
  const users = useSelector((state) => state.users);
  users.forEach(user => {
    rows.push({firstName: user.public.firstName, lastName: user.public.lastName, friendCount: user.public.friends.length})
  });
  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
    </div>
  );
}
